import React, {Component} from "react";

class OemDetail extends Component{
    constructor(props){
        super(props);
        this.state = {
            isLoaded:false,
            items:[]
        }
    }

    componentDidMount(){
        var rooturl = window.location.href;
        rooturl = rooturl.split(":");
        var eom_id = rooturl[3];
        console.log(rooturl);
        var fetchurl = 'http://13.233.237.220:8091/getOemdetailsById?oem_id='+eom_id;
        console.log(fetchurl);
        fetch(fetchurl).
        then(res=>res.json()).
        then(json => {
            this.setState({
                isLoaded:true,
                items:json
            })
        });
    }


    render(){
        console.log(this.state.items);
        var { isLoaded, items } = this.state;
        if(!isLoaded){
            return <div>Loading ...</div>
        }else{
            return (
            <div>
                <h1>OEM DATABASE DETAILS</h1>
                {items.map(item=>(
                    <div key={item.eom_id}>
                        <h4 >ID {item.oem_id}</h4>
                        <h4 >Name {item.oem_name}</h4>
                        <h4 >TYPE {item.oem_type}</h4>




                    </div>

                ))}
            </div>
            )
        }
    }
}

export default OemDetail;
